import React from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';
import logo from '../../assets/admin_logo.svg';

const Navbar = () => {
  return (
    <div className='nav-bar'>
      <div className='container'>
        <Link><img src={logo} alt=''/></Link>
      </div>
    </div>
  )
}

export default Navbar
